func MassInsert_PushEvent(rows []PushEvent, db XODB) error {
	if len(rows) == 0 {
		return errors.New("rows slice should not be empty - inserted nothing")
	}
	var err error
	ln := len(rows)
	s := "(?,?,?,?,?,?,?,?)," //`(?, ?, ?, ?),`
	insVals_ := strings.Repeat(s, ln)
	insVals := insVals_[0 : len(insVals_)-1]
	// sql query
	sqlstr := "INSERT INTO ms.push_event (" +
		"ToUserId, ToDeviceId, MessageId, RoomTypeEnum, RoomId, PeerUserId, PushEventTypeEnum, AtTime" +
		") VALUES " + insVals

	// run query
	vals := make([]interface{}, 0, ln*5) //5 fields

	for _, row := range rows {
		// vals = append(vals,row.UserId)
		vals = append(vals, row.ToUserId)
		vals = append(vals, row.ToDeviceId)
		vals = append(vals, row.MessageId)
		vals = append(vals, row.RoomTypeEnum)
		vals = append(vals, row.RoomId)
		vals = append(vals, row.PeerUserId)
		vals = append(vals, row.PushEventTypeEnum)
		vals = append(vals, row.AtTime)

	}

	XOLog(sqlstr, " MassInsert len = ", ln, vals)

	_, err = db.Exec(sqlstr, vals...)
	if err != nil {
		XOLogErr(err)
		return err
	}

	return nil
}

